const express = require('express');

const app = express();
const files = {
  test: {
    b64: '',
    content: 'image/jpeg',
  },
};

app.get('/files/:file', (req, res) => {
  const data = files[req.params.file];
  const file = Buffer.from(data.b64, 'base64');
  res.writeHead(200, {
    'Content-Type': data.content,
    'Content-Length': file.length,
  });
  res.end(file);
});

app.listen(4000);
